import React, { useEffect, useState } from "react";

const Users = () => {
  let [user, setUser] = useState([]);
  useEffect(() => {
    fetch("http://localhost:4000/users")
      .then((data) => data.json())
      .then((elem) => setUser(elem));
  });



  let deleteBook = (id, title) => {
    let hi = prompt("Enter Title name");
    if (title === hi) {
      let bool = window.confirm(`Do you want yo delete ${title} book ...?`);
      if (bool) {
        fetch(`http://localhost:4000/books/${id}`, { method: "DELETE" });
        alert(`${title} Book is Deleted`);
      }
    } else {
      alert(`Book Not Deleted`);
    }
  };
  return (
    <div>
      <table border={1}>
        <tr>
          <th>id</th>
          <th>First Name</th>
          <th>Last Name</th>
          <th>Email</th>
          <th>State</th>
          <th>Number</th>
          <th>DOB</th>
          <th>View</th>
          <th>Delete</th>
        </tr>
        {user.map((elem) => {
          let { id, FirstName, LastNam, Email, State, Number, DOB } = elem;
          return (
            <tr>
              <td>{id}</td>
              <td>{FirstName}</td>
              <td>{LastNam}</td>
              <td>{Email}</td>
              <td>{State}</td>
              <td>{Number}</td>
              <td>{DOB}</td>
              <td>
                <button>View</button>
              </td>
              <td>
                <button>Delete</button>
              </td>
            </tr>
          );
        })}
      </table>
    </div>
  );
};

export default Users;
